func TestCoderSVG_Encode(t *testing.T) {

	tests := []struct {
		name    string
		content string
		wantRaw []byte
		wantErr bool
	}{
		{
			name:    "when genereted qrcode with success",
			content: "Foo Bar",
			wantRaw: []byte(svgResult),
			wantErr: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			cs := NewCoderSVG(tt.content)
			gotRaw, err := cs.Encode()
			if (err != nil) != tt.wantErr {
				t.Errorf("CoderSVG.Encode() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			if !reflect.DeepEqual(gotRaw, tt.wantRaw) {
				fmt.Printf("%s", gotRaw)
				t.Errorf("CoderSVG.Encode()")
			}
		})
	}
}
